import React, { useEffect } from 'react';
import { Grid } from '@material-ui/core';
import styles from './styles';

const UltimasPecs = props => {
  const { ultimasPecs, listaUltimasPecs } = props;
  useEffect(() => {
    listaUltimasPecs();
  }, [ultimasPecs.length, listaUltimasPecs]);
  const classes = styles();
  return (
    <Grid className={classes.ultimasPecs}>
      <Grid className={classes.ultimasPecsTitulo}>Ãšltimas PECs</Grid>
      {ultimasPecs.map(pec => (
        <Grid key={pec.id} className={classes.pec}>{`PEC ${pec.numero}/${pec.ano}`}</Grid>
      ))}
    </Grid>
  );
};

export default UltimasPecs;
